    public static getTestData(): PredictiveAnalysis{
        var result = new PredictiveAnalysis();
        var ds = DataCommon.csv2object(PredictiveAnalysis.dataCSVTest);
        var products : ProductAnalysis[] = [];
        var i = 0;
        ds.forEach((element: any) => {
            var item = new ProductAnalysis();
            DataCommon.copy(element, item);
            if (item.Id == null) item.Id = "Row"+i;
            products.push(item);
            i++;
        });

        products.forEach((element:ProductAnalysis) => {
            element.Products = [];
            for(var prop in element){
                var reg = /Product\d+/;
                if (reg.test(prop)){
                    var checked: boolean = parseInt(element[prop]) == 1;
                    if (checked)
                        element.Products.push(prop);                    
                } 
                //if (prop.indexOf("Product") )
            }
        });

        result.Products = products;
        return result;
    }

    public static getTestDataFromDB(ds): PredictiveAnalysis{
        var result = new PredictiveAnalysis();
        var products : ProductAnalysis[] = [];
        var i = 0;
        for(let element of ds){
            var item = new ProductAnalysis();
            DataCommon.copy(element, item);
            if (item.Id == null) item.Id = "Row"+i;
            products.push(item);
            i++;
        }
        for (let element of products){
            element.Products = [];
            for(var prop in element){
                var reg = /Prod\d+/;
                if (reg.test(prop)){
                    var checked: boolean = parseInt(element[prop]) == 1;
                    if (checked)
                        element.Products.push(prop);                    
                } 
                //if (prop.indexOf("Product") )
            }
        }

        result.Products = products;
        return result;
    }

